import React, { Fragment } from "react";
import Header from "./Header";
import Footer from "./Footer";
import "./Home.scss";
import image1 from "../assets/Group 685 (1).png";

const Body = () => (
  <div className="main">
    <div className="firstDiv">
      <p className="topLefttext1">
        SAVE IN BITS <br />
        EVERY
        {/* <h1 style={{ backgroundColor: "#F2C438" }}> */}
        TIME YOU SPEND.
        <br /> EARN DOLLARS DAILY.
      </p>
      {/* <div className="topRightDiv">

      </div> */}
      <img src="i" alt="Girl in a jacket" width="500" height="600"></img>
    </div>

    <div className="rowDiv">
      <div className="rowDiv1">A</div>
      <div className="rowDiv2">B</div>
      <div className="rowDiv3">C</div>
    </div>
  </div>
);

function Home() {
  return (
    <Fragment>
      <Header />
      <Body />
      <Footer />
    </Fragment>
  );
}

export default Home;
